query QueryRenderersBidFlowQuery(
  $artworkID: String!
  $saleID: String!
) {
  artwork(id: $artworkID) {
    sale_artwork(sale_id: $saleID) {
      ...BidFlow_sale_artwork
      __id
    }
    __id
  }
  me {
    ...BidFlow_me
    __id
  }
}

fragment BidFlow_sale_artwork on SaleArtwork {
  ...SelectMaxBid_sale_artwork
  __id
}

fragment BidFlow_me on Me {
  ...SelectMaxBid_me
  __id
}

fragment SelectMaxBid_me on Me {
  has_qualified_credit_cards
  __id
}

fragment SelectMaxBid_sale_artwork on SaleArtwork {
  increments {
    display
    cents
  }
  ...ConfirmBid_sale_artwork
  ...ConfirmFirstTimeBid_sale_artwork
  __id
}

fragment ConfirmBid_sale_artwork on SaleArtwork {
  sale {
    id
    live_start_at
    end_at
    __id
  }
  artwork {
    id
    title
    date
    artist_names
    __id
  }
  lot_label
  ...BidResult_sale_artwork
  __id
}

fragment ConfirmFirstTimeBid_sale_artwork on SaleArtwork {
  sale {
    id
    live_start_at
    end_at
    __id
  }
  artwork {
    id
    title
    date
    artist_names
    __id
  }
  lot_label
  ...BidResult_sale_artwork
  __id
}

fragment BidResult_sale_artwork on SaleArtwork {
  minimum_next_bid {
    amount
    cents
    display
  }
  sale {
    live_start_at
    end_at
    id
    __id
  }
  __id
}
